(function execute(inputs, outputs) {
// ... code ...
  var body = inputs.Response;
  var first = body.indexOf(':');
  var last = body.indexOf(',');
  var len = last-first-1;
  outputs.first = first;
  outputs.last = last;
  outputs.len = len;
  outputs.appian_function_id = body.substr(first+1,len);
})(inputs, outputs);

